import React from 'react'
import PropTypes from 'prop-types'

class About extends React.Component {
  render () {
    return(
      <div>
        <h1 className="header">About Us</h1>
        <p className="header-subtext">Quorum proident coniunctione ut in ea familiaritatem, an duis philosophari,
          tamen est ubi cillum proident do pariatur consectetur sed incurreret id do
          cillum admodum sempiternum ut cupidatat nulla dolore vidisse tamen, litteris eu
          incurreret. Officia do noster. Expetendis malis senserit sed ubi elit
          voluptatibus. Possumus se noster pariatur a singulis praesentibus do expetendis
          te hic senserit est nescius a mandaremus eu velit eiusmod et an nisi aliquip
          officia non quo sunt malis enim senserit ex eram nostrud an anim nulla o est
          ipsum esse quis arbitror.Velit occaecat proident sed vidisse illum culpa admodum
          esse. Sunt quibusdam te praesentibus, do aliqua coniunctione. Do qui culpa
          nostrud. Laborum ut elit, incurreret et duis commodo, est do aute quae culpa,
          duis relinqueret vidisse duis nescius.</p>
      </div>
    )
  }
}

export default About;
